import React from "react";
import "./tweet.css";
import Tweet from "./tweet.json"
function Twitter() {
    return (
        <div>
            <h3 className="h3">Twitter scams.....</h3>
            <br />
            <br />
            {
                Tweet.map(tweet => {
                    return (
                        <div className="box" key={tweet.id}><br/>
                            <strong>URL:{tweet.url}</strong><br/>
                            tweet_link {tweet.tweet_link}<br/>
                            user_id  {tweet.user_id}<br/>
                            hastag {tweet.hastag}<br/>
                            retweet_count {tweet.retweet_count}<br/>
                           share_count {tweet.share_count}<br/>
                            {tweet.description}<br/>
                            {tweet.following}<br/>
                            {tweet.followers}

                        </div>

                    )
                })
            }
        </div>
    );
}

export default Twitter;
